import React from 'react';
import { Route, Routes, Link } from 'react-router-dom';

import Header from './components/Header/Header';

function App() {
    return (
        <div className="wrapper">
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="about" element={<About />} />
            </Routes>

            <Header></Header>
        </div>
    );
}

export default App;
